    });
  });
  test('POST: /api/check - Check a puzzle placement with missing required fields', done => {
    chai.request(server).post('/api/check').send({
      puzzle: '..9..5.1.85.4....2432......1...69.83.9.....6.62.71...9......1945....4.37.4.3..6..',
