      puzzle: '..9..5.1.85.4....2%32......1...69.83.9..$..6.62.71...9....!.1945....4.37.4.3..6..',
      coordinate: 'A1',
      value: '5'
    }).end(function (err, res) {
      assert.equal(res.status, 200);
      assert.equal(res.body.error, 'Invalid characters in puzzle');
